import React from "react";
import "./../css/style.css";
import Carrito from "./../img/Carrito.jpg";
import LogoCliente from "./../img/Logo-nombre.jpg";
import Button from "./Button";

const Navbar = () => {
  return (
    <header>
      <div class="navbar">
        <a href="#">
          <img src={LogoCliente} width="220px" alt="Logo de la empresa" />
        </a>
        <nav>
          <ul>
            <li>
              <Button
                onClick={() => {
                  console.log("Click!");
                }}
                text="Contacto"
              ></Button>
            </li>
            <li>
            <Button
                onClick={() => {
                  console.log("Click!");
                }}
                text="Ingresar"
              ></Button>
            </li>
            <li>
              <Button
                onClick={() => {
                  console.log("Click!");
                }}
                text="Registrarse"
              ></Button>
            </li>
            <li>
              <img class="carrito" src={Carrito} width="50px" alt="Carrit" />
            </li>
          </ul>
        </nav>
      </div>
    </header>
  );
};

export default Navbar;
